import React, {useState} from 'react'
import Axios from 'axios'

function Test() {

  const [data,setData] = useState([]);
  const [dName,setDName] = useState("");

  const getTest = () => {
    Axios.get("http://45.77.232.166:8080/get-pcos").then((response)=> {
      console.log(response);
      setData(response.data);
      var i;
      for(i = 0; i < data.length; i++) {
        setDName(data[i].name);
      }

    })
  }

  return(
    <div>
      <button onClick={getTest}>Get Info</button>
      <text>{dName}</text>
    </div>
    
  );
}

export default Test;
